import ReactDOM from 'react-dom';
import { Inputs } from './Inputs';

export default function Build (props) {


    const concat = () => { 

      return (
        <div>
                 URL: {props.url} <br />
      Source: {props.source}<br />
      Medium: {props.medium}<br />
      Campaign: {props.campaign}<br />
      Content: {props.content}<br />
      Term: {props.term}
        </div>
              )
    }

    return (
      <span>
      URL: {props.url} <br />
      Source: {props.source}<br />
      Medium: {props.medium}<br />
      Campaign: {props.campaign}<br />
      Content: {props.content}<br />
      Term: {props.term}
      </span>
      )

}
